import React from 'react';
import './App.css';
import Search from "./searchbar"; 
import Results from "./results";
import {BrowserRoute as Router, Route, Switch} from 'react-router-dom'; 

function App() {
  return (
    <Router>
      <div className="App">
        <Switch>
          <Route />
          <Search />
          <Results /> 
        </Switch>
      </div>
    </Router>
  );
}

export default App;
